import React from 'react';
import AllStudentsGraph from '../../containers/AllStudentsGraph.js';
import { render } from 'react-dom';
import Data from '../Data/Data';
// import ChartExample from "../ChartExample/ChartExample";

class App extends React.Component {
	constructor() {
		super();
		this.state = {
			dataList: Data
		};
	}

	render() {
		return (
			<div className="App" style={{ width: '100%' }}>
				<h1 style={{ textAlign: 'center', color: '#221D23' }}>Student Dashboard</h1>
				<ul>
					<li>
						<a href="" />Home
					</li>
					<li>
						<a href="" />Students
					</li>
				</ul>
				<div>
					<h3 style={{ textAlign: 'center', color: 'raisinblack' }}>All Students Average</h3>
					<AllStudentsGraph data={this.state.dataList} />
				</div>
			</div>
		);
	}
}

export default App;
